import React, {Component} from 'react';
import Form from './components/Form';
import Listavideos from './components/Listavideos';
import {Route, Switch} from 'react-router-dom';
import './App.css';
import Api from './api/Api.js'

class App extends Component {
  state={
    videos:[] ,
    selectedVideos:null,
  }
  handleSubmit= async(termobusca) =>{
    const resposta= await Api.get('search', {
    params:{
      part:'snippet',
      maxResults:15,
      key:'AIzaSyCP8lufKgfTZ7tDE1gkRkaf4_DCyFXJ32o',
      q:termobusca
  }} );
    this.setState({videos: resposta.data.items, selectedVideos: resposta.data.items[0]});
    console.log(this.state.selectedVideos)
  }
  render(){
    return (
    <div>
        <Switch>
            <Form className="App" onFormSubmit={this.handleSubmit}  />
            <Route component={Form} /> 
            <Listavideos videos={this.state.videos}/>

        </Switch>



    </div>
  );

 }

}

export default App;
